import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <React.Fragment>
      <form method="PUT" action='http://localhost:8080/credential'>
        <label>Key</label>
        <input name='key' required />
        <label>Shared Secret</label>
        <input name='shared_secret' required />
        <button type='submit'>Add Credentials</button>
      </form>
    </React.Fragment>
  );
}

export default App;
